    static class BasicBinaryMatrix implements BinaryMatrix {

        private final int[][] mdata;

        public BasicBinaryMatrix(int[][] mdata) {
            this.mdata = mdata;
        }

        @Override
        public int get(int x, int y) {
            return mdata[x][y];
        }

        @Override
        public List<Integer> dimensions() {
            return Arrays.asList(mdata.length, mdata[0].length);
        }
    }

    private List<Solution> solutions;

    @BeforeEach
    void setUp() {
        solutions = List.of(new BruteForceSolution(), new Solution1(), new Solution2());
    }

